extractSingle = head . (\(Right x) -> x)

su = extractSingle (parse csuParser "" "4...3.......6..8..........1....5..9..8....6...7.2........1.27..5.3....4.9........")
pzGood = parseSudoku "good.su" >>= return . extractSingle

pz1 = Puzzle [Move (loc 1 1) 1]
pz2 = Puzzle [Move (loc y x) (3 * (y - 1) + x) | x <- [1..3], y <- [1..3] ]
pz3 = (\(Puzzle g) -> Puzzle $ init g) pz2

tree = puzzleTree su

solns = puzzleSolutions su

soln = head solns

getPuzzleNumber :: Int -> IO (Parsed [Puzzle])
getPuzzleNumber n = parseSudoku $ "tests/" ++ show n ++ ".su"

puzzles = do 
  puzzles' <- mapM getPuzzleNumber [1..80]
  return $ mapMaybe extract (zip [1..] puzzles')
  where extract (n, Left err) = Nothing 
        extract (n, Right val) = Just (n, head val)
        
